import React from 'react'
import Navbar from '../Navbar/index'
import GlobalStyles from '../globalStyles'

const Layout = ({children}) => {
    return (
        <>
    
        <nav>
          <Navbar/>  
        </nav>
        <main>
            {children}
        </main>
        
        </>
    )
}

export default Layout
